	add("isolation", "{\"term\":\"isolation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"{{defdate|1800}} From French \u0027isolation\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being isolated, detached, or separated\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of isolating\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state of not having diplomatic relations with other countries (either with most or all other countries, or with specified other countries\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, W. Raymond Duncan, “Problems of Cuban Foreign Policy”, chapter 20 of w:Irving Louis Irving Louis Horowitz (editor), \u0027Cuban Communism\u0027, Fifth Edition, Transaction (publisher, 1985), [http://books.google.com/books?id\u003dIK-W0rVY8IIC\u0026amp;pg\u003dPA486\u0026amp;dq\u003disolation page 486\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As of 1975, diplomatic ostracism is still imposed by the Organization of American States (OAS). The inter-American community also exercises a trade embargo against Cuba. But even within this context of hemispheric \u0027\u0027isolation\u0027\u0027, Havana’s diplomacy is strikingly contradictory\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027 September, Jon Brook Wolfsthal, “The Israeli initiative”, in \u0027w:Bulletin of the Atomic The Bulletin of the Atomic Scientists\u0027, Volume 49, Number 7, [http://books.google.com/books?id\u003dpQwAAAAAMBAJ\u0026amp;pg\u003dPA8\u0026amp;dq\u003disolation page 8\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Israel could offer to ease North Korea’s \u0027\u0027isolation\u0027\u0027 with diplomatic recognition, ¶ But Washington’s strategy of increasing North Korean \u0027\u0027isolation\u0027\u0027 left no room for back-channel talks with Tel Aviv\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Dore Gold, \u0027The Rise of Nuclear Iran: How Tehran Defies the West\u0027, Regnery Publishing, ISBN 9781596985711, [http://books.google.com/books?id\u003dBuvEzASMq3UC\u0026amp;pg\u003dPA49\u0026amp;dq\u003disolation page 49\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"It [Europe] now pressed Washington to begin direct talks with Tehran, but Undersecretary of State Nicholas Burns, Rice’s point man on Iran, still stressed that diplomatic \u0027\u0027isolation\u0027\u0027 of Iran—and not diplomatic engagement—was the only acceptable approach for dealing with the Iranian nuclear challenge\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The obtaining of an element from one of its compounds, or of a compound from a mixtur\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The separation of a patient, suffering from a contagious disease, from contact with other\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"a database property that determines when and how changes made in one transaction are visible to other concurrent transactions\", \"priority\":12}]}, \"synonyms\":{}}");

